import React, { useState, useEffect } from "react";
import API from "../../utils/API";

function Day() {
  const [currentBooking, setCurrentBooking] = useState(["hi", "hi"]);
  useEffect(() => {
    const date = "2021-05-12";
    API.getBookings(date).then((res) => {
      console.log(res.data);
      setCurrentBooking(res.data);
      log();
    });
  }, []);

  const log = () => {
    console.log(currentBooking);
  };

  return (
    <div>
      {currentBooking.map((event) => {
        return <div key={event.id}>{event.description}</div>;
      })}
    </div>
  );
}

export default Day;
